2 days & 1 night
Ideal for those looking for:
A youthful & social atmosphere
Fun Sailing Adventure in the Whitsundays
If you’ve got limited time to make friends and visit the Whitsunday icons, Siska, a classic sailing yacht, is a boat for you!
With a particularly roomy interior, custom-built for charters in the Whitsundays, there is ample seating space and an open plan accommodation. Perfect for getting everyone together to watch the sunset with a drink at the end of the day!
Meeting Time and Location
Please make sure you have completed the online waiver form 72 hours before your vessel departure. Complete your online waiver
Take a guided bush walk to the Hill Inlet Lookout to get that awesome photo of the world-famous Whitehaven Beach. After taking in those postcard views get amongst it and submerge your toes in the unique silica sand. Climb the driftwood tree, say hello to the local marine critters or try beachcombing for shells.
In the afternoon you’ll sail north to another island where you’ll anchor just before sunset. Enjoy a drink and pre-dinner snacks and be mesmerized by the golden hour as the sun sets over the Whitsundays. After dinner, grab a drink and get stuck into a conversation with new mates.
Early rise for breakfast, then kit up with snorkeling gear, ready to jump in over the fringing coral reefs. Stunning tropical fish and other marine life, a turtle if you’re lucky, will welcome you into their home as they swim, dart and go about their life. Time for morning tea before heading to another location for a swim, snorkel or a beach stop.
After lunch, it is time to set the sails once again and make way across the Whitsunday Passage. Arrive back into Airlie Beach at 4 pm. (Perfect time to get to your accommodation, refresh and meet your new friends out for an after party!)
All meals and snacks are included for the duration of your trip. Our crew freshly prepares each meal for you to enjoy using locally sourced, seasonal fruits and vegetables.
Usually served buffet style; you can choose to eat anywhere onboard. Meals are a great communal time to get to know your fellow travellers.
The menu is as follows:
Cold Cut Meats & Cheese
Garden Salad, Pasta Salad
Cookies, Tea & Coffee
General Snack Platter with Dips
Spaghetti Bolognese with Parmesan, Garlic Bread
Tea & Coffee, Fruit Juice
Cookies, Lamingtons, Tea & Coffee
Services of skipper and crew, all meals and snacks, tap water, tea and coffee, snorkelling equipment and basic tuition, stinger suit, and all bed linen.
Please pack in a soft-sided, zipless bag.
What to bring: clothes, beach and bath towel, toiletries, hat, swimwear, sunscreen, jacket/sweater, camera, sunglasses, runners or sandals for island walks.
Siska has an open-plan style of accommodation on board made up of single and double beds. Bathroom facilities are shared.
Marina offers paid parking for your trip time for a cost of $24 that could be arranged during check-in process.
This vessel is available to
Coral Sea Marina, Shingley Drive, Airlie Beach, QLD 4802
