Ideal for those looking for:
Families and small groups, romantic getaways, small groups, & soft adventure
Idyllic Island Sailing Adventure
Prima provides small-group sailing adventures around the Whitsundays. Prima was built for charters in the Whitsundays and is comfortable, lovingly presented with plenty of seating. There are a large saloon and dining area that can seat all 12 guests at once.
The deck has a shaded canopy over the helm with lots of seating, plus a cushioned area for sunbathing. Bring your own drinks and store them in the guest fridge for easy access. No two trips are the same as we take you from one carefully selected, idyllic island location to the next.
Services of skipper and crew
