Our trip returns to the meeting point
Sample Itinerary (2 Days & 1 Night)
Find anchorage in a secluded bay for a chance to jump in for a snorkel; meet the underwater life, try and find Nemo, maybe even bump into a turtle. Then be taken to your overnight anchorage in one of the many bays on Hook Island. Enjoy sunset snacks and a drink and talk about the day with your new friends before dinner is served. Take a seat on deck and view the constellations above you before heading to bed.
All meals and snacks are included for the duration of your trip. Our crew freshly prepares each meal for you to enjoy using locally sourced, seasonal fruits and vegetables.
Usually served buffet style; you can choose to eat anywhere onboard. Meals are a great communal time to get to know your fellow travellers.
Donuts, Tea, and Coffee
: Pesto Pasta Salad, Tuna Salad, Cooked Meats, Deconstructed Salad, and Wraps
Chicken and Vegetable Skewers, Fresh Seasonal Salad, Potato Salad, and Garlic Bread
(Vegetarian Option: Marinated Tofu)
Cereals, Fruit Salad, Croissants, Spreads, Yoghurt, Tea, and Coffee
Build your own burgers – Burger Patties, Fried Onion, Coleslaw, Bread Rolls
(Vegetarian Option: Vegetarian Burger Patties)
Services of skipper and crew, all meals and snacks, tap water, tea and coffee, snorkelling equipment and basic tuition, bath towel, stinger suit, and all bed linen.
Prima has a BYO policy for all soft and alcoholic beverages. No drinks are for sale on board.
Please pack in a soft sided zipless bag.
What to bring: clothes, beach towel/sarong, toiletries, hat, swimwear, sunscreen, jacket/sweater, camera, sunglasses, runners or sandals for island walks.
Prima has a range of private cabins and open plan style accommodations to suit everyone. There are two private double cabins with ensuite bathroom facilities, two private double cabins with shared bathroom facilities and a double bed, and two single beds in open-plan accommodation with shared bathroom facilities.
